Консультативно-диагностический центр "Клиницист" начал свою историю в 2002 году как специализированное отделение ультразвуковой диагностики. Являясь первооткрывателем в данной области, центр в течение 8 лет ведет свою деятельность по оказанию высококачественной медицинской помощи. В настоящее время "Клиницист" - это сеть многопрофильных медицинских центров, филиалы которой мы постарались расположить как можно ближе к каждому пациенту.

В состав центра входят:
1. Отделение диагностики:
• Все виды УЗИ;
• ЭКГ.
2. Консультативный отдел:
• Акушер-гинеколог;
• Кардиолог;
• Гастроэнтеролог;
• Уролог;
• Дерматолог-венеролог;
• Невролог;
• Хирург;
• Гинеколог-репродуктолог;
• Гинеколог-эндокринолог;
• Уролог-андролог;
• Эндокринолог;
• Аллерголог-иммунолог;
• Терапевт;
• Психотерапевт;
3. Отделение лечения бесплодия. Все виды специализированной помощи, включая исследования проходимости маточных труб ЭхоГСГ и искусственные инсеминации;
4. Отделение малоинвазивных (безоперационных) манипуляций. Новейшая технология, позволяющая без операционного вмешательства проводить лазерное удаление узлов щитовидной железы, образований кожи, пункции,склеротерапии;
5. Отделение восстановительного лечения;
6. Дневной стационар

